import axios from "axios";

const LoginApis ={}

LoginApis.login = async (data)=>{
    let url = "http://127.0.0.1:8000/api/user/login";

    const res = await axios.post(url, data).then(response=>{
        return response;
    }).catch(error=>{
        return error.response;
    })
    return res;
}

export default LoginApis
